import { Component } from "react";

import { Link } from "react";

import styled from "styled-components";

const NavBar = styled.nav`
  background-color: #ffffff;
  height: 9vh;
  border: 2px solid black;
  display: flex;
  align-items: center;
`;

const WebNameAndLogoContainer = styled.div`
  display: flex;
  align-items: center;
  margin-left: 2%;
`;

const WebLogo = styled.img`
  width: 48px;
  height: 48px;
`;

const WebsiteName = styled.p`
  font-family: "Playfair Display";
  font-size: 32px;
  margin-left: 5px;
`;

const NavItemsContainer = styled.ul``;

const NavItem = styled.li``;

class Header extends Component {
  render() {
    // eslint-disable-next-line
    const success = "yes";
    return (
      <NavBar>
        <WebNameAndLogoContainer>
          <WebLogo
            src="https://templesofindia.org/assets/images/tofi_logo/tofi-logo_navbar.png"
            alt="tofi logo"
          />
          <WebsiteName>Temples of India</WebsiteName>
        </WebNameAndLogoContainer>
        <NavItemsContainer>
          <Link to="/">
            <NavItem>Home</NavItem>
          </Link>
        </NavItemsContainer>
      </NavBar>
    );
  }
}

export default Header;
